import './App.css';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';

function App() {

  const handleSubmit = (event) => {
    event.preventDefault();
    let result = 0;
    const k = event.target.k.value;
    if(k === 0) {
      result = 0;
    } else if(k == 1 || k==2) {
      result = 1;
    } else {
      let first = 1;
      let secound = 1;
      for(let i=2; i<k ; i++) {
        result = first + secound;
        first = secound;
        secound = result;
      }
    }

  }

  return (
    <Container>
      <Form.Label>Enter k number of fibonacci sequence</Form.Label>
      <Form.Control type='number' name='k'></Form.Control>
      <Button variant='primary' type='submit'>
        Calculate
      </Button>
      <Form.Control type='number' disabled name='result'></Form.Control>
    </Container>
  );
}

export default App;
